#include <iostream>
#include <string>
#include <vector>
#include <algorithm>
using namespace std;

int main()
{
    string s = "";

    string p = "";
    cout << s.size() << "," << p.size()<< endl;
    if(s.size() < p.size()) return {};
    sort(p.begin(),p.end());
    vector<int> result;
    for(int i=0;i<=s.size()-p.size();i++) //如果s长度小于p,则s.size()-p.size()会很大，因为为无符号
    {
        string ss = s.substr(i,p.size());
        sort(ss.begin(),ss.end());
        if(ss == p) result.push_back(i);
    }
    return 0;
} //无须排序，不然排序是及其浪费时间的。
   

