//变位词
//对p中的字符进行统计，
//每次对p个长度的字符串做如下操作，判断字串是否都在map中出现了
//TLE 仍旧有许多比较重复，考虑采用滑动窗口方式
vector<int> solve(string s,string p)
{
    vector<int> result;
    map<char,int> dict;
    for(int i=0;i<p.size();++i)
        dict[p[i]]++;

    for(int i=0;i<s.size()-p.size();i++)
    {
        bool flag = true;
        map<char,int> tmp(dict);
        for(j=i;j<i+p.size();j++)
        {
            if(tmp.find(s[j]) != tmp.end())
            {
                if(tmp[s[j]] == 0) 
                {
                    flag = false;
                    break; //说明当前个数不匹配
                } 
                tmp[s[j]]--;
            }
            else
            {
                flag = false;
                i = j; //当前字符都不存在，考虑连续性，从该字符之后计算。
                break;
            }
        }

        if(flag) result.push_back(i);
    }
    return result;
}

