    //用hash表记录而不是求和记录
    vector<int> sv,pv(128,0); //不能一起声明Runtime Error
    for(int i=0;i<p.size();i++)
    {
        sv[s[i]]++;
        pv[p[i]]++;
    }

    if(sv == pv) result.push_back(0);

    for(int i=0;i<s.size()-p.size();i++)
    {
        pv[s[i]]--;
        pv[s[i+p.size()]]++;
        if(sv == pv) result.push_back(i+1);
    }
